  return (
    <div className="sidebar">
      <div className="sidebar__header">
        <Avatar />
        <div className="sidebar__input">
            <SearchIco />
        </div>
      </div>
      <div className="sidebar__chat"></div>
    </div>
  );
}

export default Sidebar;
